func TestIcpClient_GetCookies(t *testing.T) {

	client := NewIcpClient()
	err := client.GetCookies()
	if err != nil {
		t.Fatal(err)
	}
	err = client.GetToken()
	if err != nil {
		t.Fatal(err)
	}

	t.Logf("cookie:%s\n", client.cookie)
	t.Logf("token:%s\n", client.token)

	uuid, distance, err := client.ImageVerify()
	if err != nil {
		t.Fatal(err)
	}

	t.Logf("uuid:%s", uuid)
	t.Logf("distance:%d", distance)

	sign, err := client.GetSign(uuid, distance)
	if err != nil {
		t.Fatal(err)
	}
	t.Logf("sign:%s", sign)

	//北京无忧创想信息技术有限公司
	//51cto.com.cn
	//京ICP备09067568号-5
	//京ICP备09067568号
	domainInfo, err := client.GetIcpInfo("furywizz.xyz")
	if err != nil {
		t.Fatal()
	}
	fmt.Print(utils.Prettify(domainInfo))

}

func Test_match(t *testing.T) {

	imageJson := `{
    "code": 200,
    "msg": "操作成功",
    "params": {
        "bigImage": "",
        "height": "78",
        "smallImage": "",
        "uuid": "13b22cf5-0162-4b62-a29a-983d902c48cb"
    },
    "success": true
}`

	b := "data:image/jpeg;base64,"
	//b := "data:image/jpeg;base64,"

	s := "data:image/jpeg;base64,"
	//s := "data:image/png;base64,"
	var param ImageRet

	err := json.Unmarshal([]byte(imageJson), &param)
	if err != nil {
		t.Fatal(err)
	}

	alpha, block, err := preProcess(s)
	if err != nil {
		t.Fatal(err)
	}
	defer block.Close()

	_, bg, err := preProcess(b)
	if err != nil {
		t.Fatal(err)
	}
	defer bg.Close()
	loc := Match(bg, block, alpha)
	t.Logf(`{"distance":%d}`, loc.X)
}
